export class session{
    isSessionSelected : boolean;
    sessionId : string;
    sessionName : string;
    sessionTime : string

    constructor (){
        this.isSessionSelected = false;
        this.sessionId  = "";
        this.sessionName ="";
        this.sessionTime = "";
    }

    static getAllSessions(): session[] {
        return [
          { sessionId: '0', sessionName: 'Student', isSessionSelected: false },
          { sessionId: '1', sessionName: 'Faculty', isSessionSelected: false },
          { sessionId: '2', sessionName: 'Professional', isSessionSelected: false },
        ];
      }

}
